        internal static int FindMaxConsecutiveOnesInBinaryArray(int[] nums)
        {
            int max = 0;
            int currentMax = 0;

            Console.WriteLine($"Length: {nums.Length}");

            for (int i = 0; i <= (nums.Length - 1); i++)
            {
                if (nums[i] == 1)
                    currentMax++;
                else
                {
                    if (max < currentMax)
                    {
                        Console.WriteLine($"Max: {max} CurretMax: {currentMax} Index: {i}");
                        max = currentMax;
                        currentMax = 0;
                    }
                    else
                    {
                        currentMax = 0;
                    }
                }
            }

            if (max < currentMax)
            {
                Console.WriteLine($"2 : Max: {max} CurretMax: {currentMax}");
                max = currentMax;
            }

            Console.WriteLine(max);


            return max;
        }
    }
